import React from 'react';

const Body = () => {
    return (
        <div>
            <h1>Willkommen auf unserer Nachhilfeplattform für Kinderlernen</h1>
            <p>Hier können Kinder Spaß haben und gleichzeitig lernen.</p>
        </div>
    );
}

export default Body;
